import Link from "next/link";
import fetch from 'isomorphic-unfetch';

const Robots = (props) => {
    return (
        <div>
            <h1>Robots</h1>
            <Link href='/'>
                <button>Home</button>
            </Link>
            <ul>
                {props.robots.map(robot => (
                    <li key={robot.id}>
                        {robot.name}
                    </li>
                ))}
            </ul>
        </div>
    )
}

Robots.getInitalProps = async function () {
    const res = await fetch("https://jsonplaceholder.typicode.com/users")
    const data = res.json();
    return {
        robots: data
    }
}


export default Robots;
